INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJJ0kngM1gei4R9Lx2Kp9WMSY', 'Mariama Oktavia Nainggolan', '4', 'gak ada masalah pake google map tempatnya satu area gitu dgn museum ullen sentalu makanan cenderung kering dan agak keras sauce condimentnya kurang harga sedikit di atas rata kayaknya kekurangan karyawan krna lama banget baru makanan minumannya datang kalo mau datang baiknya jangan pas jam makan siang susah nyari tempat terlepas dr food nya yg standar ambience dan tempatnya cakep adem cantik buat foto juga serasa ada hawa mistis jg');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJJ0kngM1gei4R9Lx2Kp9WMSY', 'Dida Saraswati', '4', 'tempatnya sangat indah baik dari lingkungan sekitar maupun desain bangunan untuk pelayanan sebaiknya ditingkatkan lagi terutama kalau ada tamu datang sebaiknya lebih gesit dalam menyambut mengarahkan tamu ke tempat duduk yg kosong lalu mencatat menu yg dipesan ke sini pesan nasi goreng omelet chicken rolade soup untuk nasi gorengnya benerbener enak dari rasa aromanya jadi ini sangat direkomendasikan buat yg pengen nyoba menu apa tapi bingung sayangnya untuk soup yang agak kurang dengan harga yg pricey tapi tidak sebanding dengan isian sayurannya yang sangat sedikit kalau untuk chicken roladenya oke sih');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJJ0kngM1gei4R9Lx2Kp9WMSY', 'Abdul Razzaq', '5', 'beukenhof restaurant menyajikan makanan ala barat dengan arsitektur ala belanda kuno sengaja berada di tengah museum ullen sentallu restoran ini menjadi sajian pamungkas setelah kenyang dengan sejarahsejarah yang dipaparkan selama tur dalam museum entah ada yg memilih tur jam atau yg menit sajiannya tidak nanggung saya pesan tuna steak yang menurut saya cukup enak dan rasanya seperti makan beef steak sayur dan mash potatoesnya cukup fresh dan bikin kenyang ngga nanggung tapi tentu saja tidak hadir denga harga murah minimal harus merogoh kocek di ribu untuk dapat kenyang meski begitu sayang untuk dilewatkan apalagi bagi turis domestik seperti saya yang jauhjauh ke dekat merapi hanya untuk bermain dan fotofoto di museum saja');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJJ0kngM1gei4R9Lx2Kp9WMSY', 'Cahyo Kuncono', '5', 'buat yang mau ke resto ini langsung masuk lewat jalan di sebelah museum meter gak perlu beli tiket suasananya seperti rumah belanda jaman dulu asri dan dingin bagi yang membawa kendaraan roda dua siapkan jas hujan karena disini sering hujan tibatiba makanannya enak bersih harga masih affordable namun perlu improve buat sayurannya agar lebih menarik mungkin bisa ganti timun dengan avocado cheesecake lebih soft lagi agar saat dipotong tidak kesusahan untuk steak tuna jangan overcook agar saat dipotong tidak keras kentangnya juga bisa dibuat variasi seperti mashed potato');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJJ0kngM1gei4R9Lx2Kp9WMSY', 'Harits', '5', 'restoran dengan nuansa belanda yang berada di dalam area ullen sentalu disini suasana nya tenang dengan gaya restoran seperti di belanda ada unsur lawas nya gitu deh untuk harga makanan disini lumayan pricey yah jelas karena lokasi berada di dalam lokasi ullen sentalu dan dengan konsep belanda gitu untuk makanan nya saya pesan lasagna sama spaghetti gitu untuk rasanya enak semua kok penyajian nya juga bagus disini yang menjual itu suasana dan kenyamanan nya tapi sayang kemarin saya kurang dilayani dengan baik harus nya pelayanan melayani pesanan saya di meja tetapi ini saya harus ke meja kasir untuk menaruh pesanan saya minta seat outdoor malah disuruh kedalam padahal seat outdoor masih ada yang kosong ya gapapa lah bisa buat pelajaran kedepan nya');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJJ0kngM1gei4R9Lx2Kp9WMSY', 'Rizky D. Novyantika', '5', 'so happy akhirnya cobain beukenhof setelah menjadi wishlist udah lama wheheh kesini buat makan dan chill sambil baca buku benerbener mendukung banget cumaa sebenernya weekend kayaknya ga begitu oke kalau mau lamalama karena rame banget kebetulan kesini pagipagi jadi masih ngerasain tenangnya suasana pagi di beukenhof makanannya surprisingly enaaaak dan tidak mengecewakan sama sekali definitely will be back ');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJJ0kngM1gei4R9Lx2Kp9WMSY', 'NINA KORDA', '5', 'enak masakannya menarik suasana nya enak bangt vibes so western ditunjang hawa yg sangat sejuk di kaliurang rekomen bg yg suka western food harga emg rada mahal sihâ€¦ pelayanan tata ruang baik ada butiknya di sebelahnya ok lho cantik brgnyaâ€¦ hrg wajar asesorisnya emang mahal batu asli impor batik kaosnya hrg normal ukuran kecil besar ada jd bg yg bdnnya kecil bs dpt ukrn pas situ heheâ€¦');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJJ0kngM1gei4R9Lx2Kp9WMSY', 'Chadijah Aljufri', '5', 'setelah keliling museum saya sempatkan mampir dan makan di beukenhof restaurant suasananya seperti ada di luar negeri udaranya sejuk interiornya bagus menu makanannya ada yang nusantara dan barat saya kira tempat sebagus ini pasti harga makannya mahalmahal tapi ternyata ngga juga saya pengen sih balik lagi kesini staffnya juga ramahramah');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJJ0kngM1gei4R9Lx2Kp9WMSY', 'Admin Tanggal Gajian', '4', 'menikmati tanggal gajian dengan museum date sama kesayangan âœ… ngafe estetik âœ… semua bisa dilakuin di ullen sentalu ðŸ¤ di dalemnya ga cuma museumnya aja yang bagus tapi ada beukenhof restaurant yang bangunannya juga cakeup bener kalo menurut admin di antara yang dipesen sih paling enak cordon bleu sama chicken wellington yang chicken wellington kemarin sempet minta ganti sausnya karna kalo ga salah sbenernya ada alkohol deh agak lupa juga chicken pesto spaghetti juga lumayann kalo spaghetti nya lebih suka yg ini daripada yang di cordon bleu sedangkan kalo asam daging kemarin rasanya kurang strong dan dagingnya dikit sihh kalo cheesy kroket nya masih oke lahh walau sebenernya ada ekspektasi lebih hehe overall semua rasanya masih okay dan porsinya bukan yang ngenyangin banget buat perut karet kita wkwk harganya juga cukup pricey tapi harganya emang cukup masuk akal sih buat tempat wisata ullen sentalu beukenhof restaurant');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJJ0kngM1gei4R9Lx2Kp9WMSY', 'Latifa Alif Agwinda', '4', 'suasana resto menyenangkan bangunan seperti masa kolonial makanan enak minuman enak harga lumayan pricey mungkin karna masih di area museum tp wroth dg rasanya pelayanan dari jutek banget apa memang di ajarin seperti itu ya naruh makanan juga di tumpuk di satu sisi padahal tour guide resepsionis di museum ini ramah dan helpfull sekali');
