INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJgbfOZjRYei4RgtVB5W3lH2g', 'Azim Jamal', '5', 'penasaran ingin coba suasana cafe yang unik nemulah tempat ini specialty nya jelas cokelat dan agak bingung mau pesen apa karena emang banyak bgt pilihan minuman cokelatnya tempatnya agak kecil tapi cukup minuman yang saya pesan enak tp klo lava cakenya mejurut saya bias secara keseluruhan cafe ini oke');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJgbfOZjRYei4RgtVB5W3lH2g', 'Ditya Ramadhanti', '5', 'lokasi strategis tempat parkir lumayan luas buat motor dan mobil ada indoor dan outdorr servicenya luar biasa ramah banget dan feels like home bisa buat nugas cocok banget buat cari inspirasi ada banyak colokan juga vibe tempatnya kaya di prancis gt kali ya dan homie banget playlistnya lagu prancis jg dan adem tenang gt menunya beragam dari mulai makanan beratsnack dessert cookies susu ice cream dan coklat harganya terjangkau milk in cookie cup pake susu coklat peppermint enak banget juara bgt sih ini cookie nya tu ga terlalu manis dan coklatnya tu yg dark gt jd pas dimakan sambil minum susu peppermintnya susu coklat peppermintnya juga enak manisnya pas coklat nya berasa bgt sm peppermintnnya berasa jd nambah seger gt ice creme chocolate nya enak banget jugak rasa coklatnya berasa banget manisnya pas dan ga enek lava you cake nya ada yg coklat sm vanila gitu dikasih topping ice cream vanila coklat juga rasa coklat cake lavanya juara banget manisnya pas legit dan cocok bgt dimakan pake eskrimnya kalau yg vanila lava cake kurang cocok karna rasanya terlalu telur gt jd aga enek ice creamnya juara banget sih kaya home made gitu dan creamy bgt ga icy yg coklat kerasa bgt darck chocolatenya');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJgbfOZjRYei4RgtVB5W3lH2g', 'agung saputra', '4', 'serba coklat mulai makanan dan minuman sampe laci juga bentuk coklat heuheu iya buat yang suka coklat bisa dicoba nih dekat bunderan ugm banget menunya cukup melimpah dengan berbagai macam minuman coklat utamanya tapi ada pilihan lain juga jangan lupa ada makanan juga disini untuk tempat berkesan homy karena emang bangunan rumah yang dialihfungsikan jadi kafe area parkir juga cukup memadai untuk sepeda motor maupun mobil ada juru parkir yang memandu');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJgbfOZjRYei4RgtVB5W3lH2g', 'Alqarny Abidah', '5', 'coklat cafe tempat ternyaman untuk ngobrol nyaman buat nugas dengan kursi sofa atau biasa juga musikmusik syahdu yang buat nyaman berlamalama di cafe ini bikin pertama kali ke cafe ini langsung pengen balik lagi kalau ke cafe ini wajib cobain iced salted coklat untuk harga memang diatas harga mahasiswa tapi kenyamanan itu yang membuat saya terbayar thankyou coklat cafe');
