INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJgbfOZjRYei4RgtVB5W3lH2g', 'Farhan Amen', '5', 'cafe yang cocok untuk para penikmat cokelat tempat yang disajikan sangat nyaman bagi siapapun yang berada disana termasuk juga untuk para mahasiswa dengan harga menunya yang terjangkau suasana di dalam cafenya juga romantis dengan bentuk meja yang ditata sedemikian rupa sehingga sangat cocok untuk kamu yang ingin date dengan kekasih pelayanan juga ramah sehingga menjadikan tempat ini tempat favorite untuk merasakan kelezatan chocolate');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJgbfOZjRYei4RgtVB5W3lH2g', 'Christa Adhi Dharma', '4', 'spesialis cokelat yang sudah eksis lebih dari tahun yang lalu menu dan rasa sajiannya konsisten dan stabil suasana yang homy juga selalu membuat kita merasa nyaman untuk bersantai atau bekerja sayangnya karena posisinya di salah satu jalan utama di tengah kota terdapat keterbatasan area parkir untuk konsumen yang menggunakan mobil');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJgbfOZjRYei4RgtVB5W3lH2g', 'Pauline Nathania', '4', 'tempatnya terletak di daerah sagan yang dekat dengan dr affandi estetika kalau malam perhatikan kiri karena tulisan coklat tidak ada lampu kalau dengan mobil ke sini harus hati karena tempat parkir lumayan sempit hanya bisa mobil maks harga makanan dan minuman ok speciality coklat menu bermacam coklat mulai dari minuman hingga makanan makanan asin juga tersedia ada tempat dalam atau luar ada juga mainan seperti uno atau monopoli untuk lepas waktu sistem pembayaran di depan');
