INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJQ0xdfsdZei4R7brC65XjZq0', 'Mariani Sutanto', '5', 'afogato di sini unik rasanya mungkin karena jenis kopi yang dipakai agak beda tidak terlalu pahit seperti afogato lain yang pernah kunikmati menu makanan beratnya juga variatif aku mencoba tortilanya walau ini menu yang termasuk baru untukku aku suka kelihatannya hanya potong tapi kenyamg sekali rasanya cafe ini cantik dan eksotik petugasnya menurutku intelek mereka santai dan sangat menolong mereka sangat memperhatikan plating dan cara menyajikan love this cafe');
