INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJQ0xdfsdZei4R7brC65XjZq0', 'Ang Tek Khun', '5', 'suka dengan tempat ini style kafenya bagus banget kameragenik instagramable nongrong di sini bakal betah banget dengan pandangan yang segar sebagai kafe kopi dan eatery yang disajikan beragam banyak banget pilihannya mulai dari breakfast light bite aneka sop macammacam salad burger sandwich healty juice sampai main course seperti kwetiau goreng seafood norwegian salmon roasted chickeb korean beef bowl baked beef rice dan ragam nasi goreng untuk kopi banyak pilihan espresso doppio cappuccino affogato vietnamese sampai cokelat dan galyco yang jadi signature');
