INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ5zoRUyRZei4RV91NA020L8k', 'Alldhyan Putra', '5', 'salah satu kafe paling nyaman di jogja menu makanan dan minuman di estuary bervariasi dan rasanya enakenak dengan makanan yang lengkap mulai dari cemilan bakery hingga makanan berat ada untuk minumannya sendiri tersedia berbagai variasi dari kopi hingga non kopi untuk yang rekomen itu choco banana dan chocho nut nya karena rasa cokletnya yang pas manisnya agak sedikit kemanisan namun masih batas wajar dan kekentalannya juga pas harganya menunya sendiri mulai dari an hingga an ribu rupiah pelayanannya sendiri juga cepat tidak sampai menit minuman sudah siap tempatnya yang paling bikin kafe satu ini jadi yang paling strategis terletak tidak jauh dari kampus ugm tidak di pinggir jalan besar namun tidak terlalu masuk ke dalam dengan jalan yang cukup untuk mobil lewat membuat lokasinya tenang kafe ini dapat menampung banyak orang dengan berbagai keperluan mulai dari nugas kumpul biasa meeting kumpul beramai ramai hingga mengadakan pesta walaupun bisa menampung banyak orang kafe ini masih terasa lega dan luas karena jarak antar kursi tidak mepet dengan berbagai jenis meja dan kursi membuat kafe ini nyaman untuk setiap orang dan keperluannya tersedia tempat untuk outdoor dan indoor yang nyaman dan dingin colokan listriknya sendiri juga banyak dan cukup untuk mengakomodir pengunjung terutama di bagian indoornya di estuary juga terdapat toilet yang bersih mushola serta ruang meeting parkir di estuary sendiri juga sangat lega baik untuk mobil dan motor kalau hujan tukang parkirnya akan memberikan plastik untuk menutupi helm kita overall tempat ini sangat nyaman untuk dikunjungi untuk yang memiliki budget hingga untuk sekali berkunjung');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ5zoRUyRZei4RV91NA020L8k', 'Dyan Wigati', '5', 'coffeshop ngumpet tetapi ternyata cukup luas tempatnya biar lebih mudah pakai gmaps aja karena tidak terlihat dari jalan besar masuk ke gang sempit tapi cukup untuk dilewati mobil area parkir juga cukup luas untuk mobil dan motor ada musola dan toilet jadi tidak perlu kawatir jika mau nongki lama disini ada area indoor dan outdoor di setiap lantai lantai kalau sore enak di outdoor sambil menikmati view dan semilir angin cocok buat hangout sama bestie bestie hehe bagian indoor jg cukup luas dan nyaman hampir setiap meja ada colokan jadi tidak perlu takut nugas lama disiniwifi pun kenceng jadi makin betah menu cukup variatif ada minuman kopi dan non kopi makanan berat dan kue kue harga cukup terjangkau standar coffeshop jaman now untuk rasa cukup enak kebetulan pas nyoba kesini pas ada diskon persen lumayanlah overall cukup menyenangkan disini cobain yuk');
