INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJj9cfEiVZei4RvtOqDmIKyVE', 'M n Rizal', '5', 'tempat yg sangat strategis tepat berada di samping tugu jogja rasa makanan enak hanya memang menurut saya belum wow parkir cukup mudah diakses saran saya apabila ke sini datang sebelum pukul dan bisa reservasi disarankan melakukan reservasi untuk dapat tempat paling nyaman untuk menikmati keramaian di tugu jogja pelayanan cukup cepat dan ramah dan harga terhitung murah untuk lokasi yg ditawarkan sensasinya luar biasa untuk seorang yg ingin menikmati suasana jogja mungkin tidak sama untuk semua orang rasa makanan bukan yg sangat enak atau wow tapi sudah terhitung enak pun yg dicari dari restoran ini adalah suasana dan pemandangannya menurut saya bukan hanya soal rasa makanan');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJj9cfEiVZei4RvtOqDmIKyVE', 'Ratna Sari', '5', 'tempatnya ramai tapi cukup fast moving jadi sabar aja kalau memang niat berkuliner ria dan menikmati view tugu yogya yang indah makanan dan minumannya enak saya pesan sop buntut teh panas dan kopi boss kopinya enak sekali penyajian juga cepat pelayannya cekatan tersedia musholla walau kecil hanya cukup untuk orang toilet juga ada di lantai');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJj9cfEiVZei4RvtOqDmIKyVE', 'Ika Shaliha Oktavia', '5', 'lebih enak reservasi terlebih dahulu jika ingin makan disini terutama pada waktu makan malam karena pada jamjam tertentu akan sangat ramai dan sulit mendapatkan meja kecuali dibantu pramusaji pilihan menunya beragam mulai dari jajanan ringan sampai makanan berat minuman sehat pun tersedia harganya cenderung agak mahal namun jika ingin mendapatkan pengalaman pada indra kecap tidak salah lagi untuk datang kemari pelayanannya super ramah dan sat set tempatnya pun bersih untuk pembayaran bisa menggunakan tunai ataupun debit');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJj9cfEiVZei4RvtOqDmIKyVE', 'Kholid Arofi', '5', 'pertama kalinya ke sini dalam tahun di jogja ternyata beneran enak enak makanannya nasgor sei sapi sambal ijonya enak roti sarikayanya juga secara suasana dan tempat memang strategis sekali di tengah land marknya jogja tempatnya cukup nyaman untuk dine in brg keluarga buat nongkrong aman temen temen juga bisa servicenya oke bgt overall memuaskan');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJj9cfEiVZei4RvtOqDmIKyVE', 'Anita Witanto', '4', 'sebagai turistertarik kesini karena terletak persis di depan tugu jogjaberharap foto di lantai atas seperti yg sering lihat di medsos namun saat weekend ternyata lantai paling atas penuh dan ternyata sangat sempit panas walaupun malam haridan tidak nyaman lebih nyaman di lantai di sini juga barista meracik kopinyasehingga harum kopi di sini pelayanan sangat baik aneka juice nya enaktidak terlalu manisdan disajikan dengan gelas cantik kekurangan terbesar di area parkirnyacukup sempitdan hingga kali tukang parkir meminta kita memindahkan mobil');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJj9cfEiVZei4RvtOqDmIKyVE', 'Erlin Apriyani', '5', 'lokasinya strategis di pinggir jalan dan deket banget sama tugu jogja untuk rasa makanan dan minuman dicompare sama harga sih ya tapi kalo untuk kongkow sama tementemen enak sih seru karena tempetnya luas dan bisa lihat icon jogja langsung pelayanan standard tapi pelayan kurang ramah lahan parkir juga lumayan untuk motor dan mobil');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJj9cfEiVZei4RvtOqDmIKyVE', 'dede satya', '4', 'lokasi kafe sangat strategis di area tugu jogja area favorit di lantai atas menu cukup lengkap minusnya ada pada tempat parkir yg terbatas dan menu makanan minuman yg standar sperti kafe pada umumnya tidak ada yang spesial');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJj9cfEiVZei4RvtOqDmIKyVE', 'Annisa Vidy', '5', 'lokasi bagus bersih nyaman layout ruangan dan meja kursi rapi banget service semua crew ramah banget dan sumeh durasi penyajian cepat menit rasa nasi bakar sei sapinya bedes banget ternyata bumbu rempahnya mantap banyak banget seinya agak alot tapi kuah sopnya seger keren pokoknya sayang ngga kebagian meja yang ada spot tugu jogjanya');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJj9cfEiVZei4RvtOqDmIKyVE', 'Tony Setiawan', '5', 'uda sering ke jogja pas weekend tapi baru kemarin ke sini pas weekday ramai banget tempat nya bisa lebih ramai waktu weekend tempat nya bagus makanan dan minumannya enak enak harga ny juga tidak terlalu mahal wajar utk sekelas cafe di tengah kota menawarkan view yang langsung menghadap tugu jogja cafe nya oke banget tapi parkirnya terbatas saran saya kalau ke sini pakai taxi online aja tapi overall okey banget experience yg di tawarkan');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJj9cfEiVZei4RvtOqDmIKyVE', 'Asti Pinarti', '5', 'finally bisa nyobain tempat ini jg setelah sekian kalinya ke jogja biasanya tempat ini selalu full dan waiting list kalo tampak luar rame penuh sesak tapi ternyata ga selalu seperti itu biasanya lantai dan lantai dipenuhin dulu nah kalo udah penuh sampe luber baru mereka membuka lantai nya makanannya enak ya beneran minumannya juga worth the price banget sih apalagi dengan view dan suasananya yg kyk gini kesulitannya cuma satu kalo kesini cari parkirannya');
