INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJj9cfEiVZei4RvtOqDmIKyVE', 'Linggo Ajip', '3', 'pilihan cafe untuk pelancong yang ingin menikmati landmark tugu jogja tersedia area parkir mobil dan motor di halaman cafe karena posisi cafe di hook simpang tugu jogja untuk tamu dengan mobil lebih mudah masuk parkir cafe dari arah barat atau timur simpang kalau dari arah utara harus berputar uturn di tugu jogja karena ada separator jalan bangunan terdiri dari lantai lantai pertama area kitchen bar dan kasir ada beberapa meja makan dan area oleholeh dan souvenir lantai kedua area makan yang cukup nyaman terbagi area indoor yang non smoking dan area outdoor untuk smoker area outdoor ini favorite nya pengunjung yang mau selfie bareng tugu jogja lantai ketiga saya belum sempat akses karena saat berkunjung masih ditutup makanan dan minuman yang ditawarkan cukup variatif ada varian minuman kopi hingga fresh juice untuk makanan mulai yang ringan seperti pisang goreng hingga sop buntut untuk cafe menurut saya harga pricey untuk minuman waktu penyajian normal namun untuk makanan cenderung lama padahal kunjungan tamu tidak ramai untuk tamu dengan anak balita tersedia booster chair dan area makan tamu cukup kid friendly bagi anakanak untuk eksplor terutama lantai dasar ac lebih terasa dingin dibanding lantai kedua');
