INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJa6fDq_2rey4RDfAo0HoAbaM', 'Putri Kusumaningrum', '5', 'udah beberapa kali kesini sii dan gak pernah ngecewain tempatnya nyaman ada lantai atasnya juga tapi dilantai atas agak masih tetep panas pdhl udah ada ac nya karyawannya juga ramah apalagi ownernya karena ngepasin hari jumat kesana yg nglayanin langsung ownernya dongg dan dijlsin detail gtuu makanan sama minumannya enak smua worth to try');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJa6fDq_2rey4RDfAo0HoAbaM', 'Sabda Apriliana Budiatmadja', '5', 'homwok paris adalah tempat yang sangat nyaman untuk bekerja dan melakukan aktivitas seharihari menawarkan konsep layaknya coworking space tempat ini memberikan suasana yang tenang dan nyaman untuk bekerja lokasi yang strategis di pusat kota membuat homwok paris mudah dijangkau saat berkunjung ke homwok paris saya sangat menyarankan untuk bekerja di lantai dua yang lebih sepi dan tenang terdapat beberapa desk meja yang luas dan dapat menampung banyak peralatan untuk mendukung pekerjaan selain itu suasana yang tenang juga membuat konsentrasi dalam bekerja semakin meningkat homwok paris juga memiliki suasana yang cukup santai dan tidak terlalu formal sehingga membuat pengunjungnya merasa lebih santai dan nyaman selain tempat duduk yang nyaman homwok paris juga dilengkapi dengan akses internet yang cepat dan stabil secara keseluruhan homwok paris adalah tempat yang sangat cocok untuk bekerja atau melakukan aktivitas seharihari lokasinya yang nyaman dan tenang serta suasana santai yang dimilikinya membuat homwok paris menjadi tempat yang sangat disarankan bagi mereka yang mencari tempat untuk bekerja atau berkumpul dengan temanteman');
