INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJTwZhrFNYei4R00VBFwD35ZI', 'Anton Pramono', '5', 'kopi sembilan rekomendasi tempat ngopi di jogja buat kamu yang suka tempat yang tenang tidak ada bising kendaraan masih menggunakan alat kopi manual suasana disini sangat menyenangkan dan refresh banget sih minimalis semi industrial un finish perpaduan tanamantanaman bikin bangunan ini makin seger area tempat duduk ada tiga gais indoor area bar beberapa tempat duduk outdoor smooking dan lantai dua varian menumenunya banyak gais mau coffee sampai noncoffee nya lengkap mocktail coffee pun ada untuk harga disini terjangkau gais cek dehh menunya âœ” tempat nyaman ï¸âœ”ï¸ parkiran ada âœ” colokan banyak ï¸âœ” wifi kenceng ï¸âœ” meja korsi nyaman banyak senderan ï¸âœ”ï¸ baristanya ramah hospitalitynya asik');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJTwZhrFNYei4R00VBFwD35ZI', 'Ainalia K Anjani', '4', 'senang sekali mengetahui ada coffee shop di dalam wilayah pogung kidul jauh dari kebisingan jakal coffee shop ini bisa kukatakan sederhana namun sungguh nyaman justru karena sederhana inilah yang membuat kopi sembilan unik saking nyamannya saya berada di sana sekitar jam lebih meskipun datang sendiri menu yg saya pesan mulai dari klasika hazelnut lalu beranjak ke singkong goreng karena mulai lapar kemudian ditutup dengan pesan purple herbs karena ingin minum yang menyegarkan sehabis hujan tempat ini juga sangat cocok untuk menuntaskan tugas kantor atau tugas kuliah pun sangat bisa sebagai ruang bersantai bersama kawan ataupun ruang me time sangat beruntung saat itu mendapat kursi yang menghadap ke jalan ditambah sedang hujan kerja rasanya bisa lebih rileks di kopi sembilan juga terdapat area lantai yang tak kalah menarik rasanya bertemu kawan atau rapat kecil di sini masih akan kondusif kapankapan bisa nih dikunjungi lagi bareng temen atau kekasih hehe');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJTwZhrFNYei4R00VBFwD35ZI', 'Arya', '4', 'bagi yang suka tipikal kopi yang strong cafe ini menarik untuk dicoba rb buat latte nya and strong tapi aku orang yang suka kopi creamy jdi kurang bisa menikmati kopinya cuma yang menarik perhatianku adalah rice bowl crispy bbq nya enak dengan harga rb next mungkin untuk experience yang lebih nyaman buat pesanan bisa diantar saja dibandingkan teriak ke konsumen dilantai buat ngambil');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJTwZhrFNYei4R00VBFwD35ZI', 'Dhyan Fidyawati', '4', 'sekitaran pogung lagi kami menemukan coffee shop rumahan yang hangat dan nyaman tampak depan coffee shop ini cukup asri dengan beberapa tanaman yang menjuntai dan satu pohon cukup besar membuat kopi sembilan terasa teduhtempat ini menyediakan area indoor di lantai sekaligus bar dan area semi outdoor yang berada di samping bar juga di lantai kursi dan meja yang di sediakan cukup ergonomis pilihan minuman dan makanan juga beragam mulai dari coffee non coffee snack sampai makan berat dengan harga yang terjangkau kopi sembilan menyediakan beberapa buku colokan dan wifi buat tementemen yang mau laptopan disini bisa banget selamat mencoba jangan lupa prokes yaa');
