INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJTwZhrFNYei4R00VBFwD35ZI', 'Nathan Anugerah Setiawan', '4', 'indonesia tempat ini oke banget buat minum kopi sambil ngerjain tugas dan sedikit nongkrong bareng temen tempatnya relatif cukup luas namun tempat parkirnya relatif terbatas harga yang ditawarkan oke dengan produk yang rasanya oke aku membeli klasika cream brulle yang merupakan kopi susu cream brulle dan aku sangat menikmatinya tempat yang bagus untuk ngopi sambil nugas english this place is really good for drinking coffee while doing assignments and hanging out little with friends the place is relatively large but the parking space is relatively limited the prices offered are okay with the products that taste okay bought the klasika cream brulle which is cream brulle milk coffee and really enjoyed it good place to have coffee while doing work');
