INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJW3qqdF9Zei4R__z2cQjHXQA', 'm. latifah', '4', 'ke mari karena antar teman sanggar untuk perform pertama masuk ke gerbang oh rame sekali parkirannya rapi berbayar masuk ke entrance gate suasana meriah karena pas lagi ultahnya klt ke di dkt gate ini ada produk umkm nya teman di jogja tapi untuk saya sendiri snack yg disediakan di dkt gate ini ga menarik sama sekali hehe maap kalo saya lihat ada pie brownies produk umkm ada ondeonde mini dll saya sampaikan di foto masuk ke foodcourt ada tenant menyediakan aneka makanan dan minuman untuk saya sendiri entah mengapa tidak tertarik dengan menumenu nya mungkin karena saya termasuk picky untuk makanan ya pilih yg bukan junkfood maksudnya akhirnya minum aja ditraktir senior minuman namanya wedang angsle minuman ini menurut saya juga biasa terdiri dari mutiara kolangkaling roti santan dengan aroma jahe dan burjo tapi kok burjonya ga kelihatan ya entah cuma setengah sendok atau seberapa wkwkwk untuk rasanya menurut saya terlalu manis karena saya tidak suka rasa manis mungkin untuk yang lain sih manisnya udah pas gapapa selera orang berbeda untuk suasana sangat rame menurut saya mungkin cukup sulit cari tempat kalo datang rombongan kalo cuma berdua atau bertiga masih tidak ada masalah alhamdulillah di sini ada mushola yang bersih kalau toilet kurang tau karena ga mampir toilet');
