INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ8b3du_dZei4R5Csj9BqdzsM', 'Euricha Fany', '4', 'place â­â­â­â­ facility â­â­â­â­ drink â­â­â­â­ food â­â­â­â­ colokan â˜‘ï¸ tempatnya enak sih buat nongki sama temen rame rame atau sendirian juga gak masalah ada semi outdoor ada outdoor tapi karna diantara jalan raya dan rel kreta jadi kudu kompromi sama kebisingan juga enaknya sore ketika orang kebanyakan kumpul deket benteng daripada deket stasiun agak keganggu sama letak parit deket antri kasir sih kayaknya ada toiletnya ada tempat cuci tangan samping kasir juga terasnya bersih sih paling cuma dedaunan dr pohon aja jadi sejuk ada colokan jg meski yg di outdoor ada makanan berat sama ringan makanan beratnya ya berat sih buat dimakan di area outdoor kurang nyaman jd nyicip yg ringan aja tahu pedas digambar menu kayak dibalut bumbu pedas tp sebenernya cuma tahu tepung dikasih bon cabe hambar cuma ketolong asin bon cabenya pisang keju banyak sih sepiring dimakan sendirian kenyang dan gk pelit kejunya dibanding cafe tugu ini better sih dan pisangnya gk terlalu lembek untuk minum ada mineral water botol kecil sama kopinya light sih alus di lidah sedangkan lechy tea nya aja total habisnya untuk semua itu karna so far gak ada yg mengganggu dan nyamanÂ² aja buat nyamil sambil ngobrol bareng suami pulangnya bisa liat sunset di selasar malio juga kasih â­ dulu deh ya');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ8b3du_dZei4R5Csj9BqdzsM', 'Evita Rahmawati', '5', 'mantaap baru sekali nyoba dan definitely bakal dateng lagi kelebihan lokasi di pusat kota jogja sebelahan sama stasiun tugu tinggal jalan dikit aja tempat luas banyak meja kursi bisa buat ramean ada yang sofa juga kamar mandi bersih dipisah cewe cowo ada mushola cukup luas buat orang pancakenya enakk ga kurang mateng ga kematengan lembuuut dan ga bau tepung saus coklatnya generous ada eskrimnyaa juga worth it buat harga harga reasonable ini menurutku di tengah kota udah murah ya kafe lainnya harga selangit loh menu banyak pol ada makanan minuman dessert lengkapp air mineral harga minus parkir motor rb parkir mobil di abu bakar ali agak jauh ada mas yg nawarin apa gatauu kumpul deket situ');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ8b3du_dZei4R5Csj9BqdzsM', 'Yoggi Then', '5', 'sepertinya ada lokasi untuk coffee shop ini pertama di area malioboro lalu kedua di dalam stasiun yogyakarta saya mencoba yang di dalam stasiun yogyakarta ketika sedang menunggu kereta lokasinya terbuka jadi bisa sambil mendengar pengumuman kereta tujuan kita pelayanan cukup cepat coffee latte nya enak dan cukup pas creamy nya selain kopi ada juga menu lainnya yang bisa dilihat di pintu depan kasir tidak terdapat ac ya di dalamnya hanya kipas angin tapi tidak pengap karena silingnya cukup tinggi');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ8b3du_dZei4R5Csj9BqdzsM', 'sukma karina', '5', 'tempatnya enak bisa ngelihat orang di malioboro dan bisa melihat kereta lewat lokasinya di bawah pohon gitu jadi rindang tersedia juga untuk yg indoor cocok buat orang tua muda maupun anak untuk minuman enak snack juga enak gak kemanisan gak eneg meskipun base nya manis pelayanan nya juga bagus ramah untuk kemasannya dan tempat juga higienis untuk harga standart sih untuk di lokasi tempat wisata');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ8b3du_dZei4R5Csj9BqdzsM', 'Clarizsa Ayu Maharani', '3', 'sebetulnya ragu mau kesini setelah membaca review dan ternyata benar kata orangorang walaupun tempat dan live music lumayan bagus tapi pelayanan dan rasanya kurang memuaskan saya pesan iced mocha latte dengan es dikurangin saat diantar pelayannya tidak menyebutkan nama pesanannya dan sepertinya salah karena coklatnya tidak terasa sama sekali bahkan kopi dan susunya juga tidak terasa');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ8b3du_dZei4R5Csj9BqdzsM', 'tsuwai', '4', 'halo entah aku aja atau ada customer lain yang juga sama waktu mampir kesana staf kasir kurang ramah not friendly terkesan ketus dan kurang membantu not helpful harga pricey standard cafe dan untuk cita rasa soso biasa aja hehe tapi paling oke dari semua menu yang dipesan kemarin nasi goreng rawon lumayan cocok masuk rasanya untuk sup rawon biasanya untuk nasi gorengnya biasa aja untuk bebek mayor kurang tasteful sambel juga terlalu banyak bawang dan minyaknya pisang goreng keju sampainya lebih lama dibanding makanannya hehe jadi ya nice to try aja tapi nggak buat langganan sorry');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ8b3du_dZei4R5Csj9BqdzsM', 'faridHRT', '4', 'lokasi sangat strategis parkir motor bisa di samping loko jika tersedia kalo mau enak ya di parkir abu bakar ali cocok buat yg habis turun dari kereta atau yg lagi jalan di malioboro saya sukanya menu non coffe boleh dibilang mercusuar bisa liat suasana sekitar sambil cuci mata ada live music');
