INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ8b3du_dZei4R5Csj9BqdzsM', 'Nur Salam', '5', 'coffe shop yang dekat dengan malioboro dan stasiun tugu yogyakarta ada berbagai kopi dari berbagai daerah dengan penyajian manual berbagai jenis makanan berat maupun ringan beragam fasilitas umum lengkap ada mushola kamar mandi dll lokasi parkir bisa di abu bakar ali atau parkir slasar malioboro tempat indoor dan outdoor ada ada live musik jika malam hari bagi para wisatawan yang membutuhkan tempat transit disini cocok sekali bisa mampir malioboro dan jln menuju stasiun tugu yogyakarta');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ8b3du_dZei4R5Csj9BqdzsM', 'Kukuh Pambuka Putra', '5', 'lumayan oke buat nongkrong ada colokan listrik juga walau berisik karena pinggir jalan lalu lintas padat tapi oke kopinya oke ibu saya yg biasa kopi tubruk jadi doyan americano banyak hiasan bertema kereta api cukup instagramable yg dateng rata anak muda layanan ramah bisa bayar pake kartu atau qris ada wastafel juga yg posisinya tepat cuma saya agak bingung kalau mobil parkir di mana rata ke sini bawa motor sih lalu lintas di sini jalan searah sebaiknya bawa motor saja jangan mobil');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ8b3du_dZei4R5Csj9BqdzsM', 'Fatmah Jp', '5', 'cocok banget makan bareng temantemankeluarga dan orang tersayangada live music nyaharga makanan keatas minuman an keatas rekomen banget nasi goreng loko nyasama pisang keju juga enak');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ8b3du_dZei4R5Csj9BqdzsM', 'Reza Horisman', '5', 'loko coffee shop kini udah ada diberbagai stasiun besar dipulau jawa salah satu disini letaknya gajauh dari exit gate st tugu di selasar maliboro arah pjl geser ya walaupun ambiance nya pasti keganggu karena berisik dengan lalu lalang kendaraan apalagi pas weekend tp vibesnya enakeun apalagi ini dijogja coffenya dan cemilannya enak usahain kesini jgn pas waktu weekend ya klo mau agak sepi dikit lagian cafenya buka jam');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ8b3du_dZei4R5Csj9BqdzsM', 'Wiwid Widarti', '4', 'menikmati pemandangan area stasiun dan malioboro suasana sore dan mlm hr paling enak disini menu standarlah gk mahal amat rasa jg spti pd umumnya kopi dan camilan mkn blm nyoba krn pas kesini hbs mkn');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ8b3du_dZei4R5Csj9BqdzsM', 'Fanda Rizqia', '5', 'harga makanan sesuai dengan kantong pelancong makanan berat seperti nasgor mie ayam kisaran harga minuman dimulai dr an tempat cozy ada wifi dan mushola serta mukenamya ada toilet duduk serga toilet jongkok ada tempat penyewaan power bank serta ada tempat makan outdoor maupun indoor');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ8b3du_dZei4R5Csj9BqdzsM', 'Dy', '4', 'tepat di sebelah stasiun tugu jogja dan malioborotempat yg lumayan nyaman buat nunggu jadwal kreta atau buat nongkrong ngopi ngopiâ€¦ada live music juga rasa relatif tempat pelayanan');
