INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ8b3du_dZei4R5Csj9BqdzsM', 'Ajahn Bram', '4', 'saya ambil foto perjalanan dari arah timur parkir abu bakar ke arah stasiun tugu dari depan sepertinya cafe ini menyenangkan saya ingin mencoba masuk kesana oh iya kalau tidak salah ada beberapa artis youtube yg sering manggung disini kan');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ8b3du_dZei4R5Csj9BqdzsM', 'B â€œAboedâ€ Hartani', '4', 'pas nginep di hotel sebrang lihat ada live music duduk santai sambil menikmati malam di malioboro mie godog nya enak harga okay');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ8b3du_dZei4R5Csj9BqdzsM', 'Resty (ChkinN)', '5', 'vibe jogja banget hanya katakata itu yang terpikirkan saat nongkrong di kafe ini ya mau gimana lagi letak kafenya sangat strategis dan berada di pusat tempat wisata terkenal di jogja malioboro kalau mampir ke malioboro mau nggak mau sesekali pastinya mampir ke tempat ini tempstnya cukup luas tempat duduknya juga banyak minuman kopinya super lattenya juga enak makanannya ada yang western ada yang makanan indo karena banyak turis lokal dan manca negara ya harganya ya moderat ke atas harga turis biasa lah pelayanannya cukup baik kita kalau mau order lamgsung ke kasir terus tinggal tunggu di meja dengan papan penanda antrian nggak lama menunggu karena mbak dan masnya banyak jadinya satset satset pembayarannya bisa pakai qrcode kas dan kartu recommended banget kalau suka kopi dan mau nongkrong di malioboro');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ8b3du_dZei4R5Csj9BqdzsM', 'Elsa Eka', '5', 'overall ok banyak tempat duduknya ada yg bisa langsung berhadapan sama rel kereta juga dan kayanya bakal jdi tempat favorit hehe makanan dan minumnya enak staff ramah ada live music juga mungkin sedikit tambahan untuk ada tempat charger di setiap sudutmejanya thank');
