INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ-wPdGPJXei4RqDLhC6w0HWg', 'Muhammad Abid Halim Gaffar', '3', 'iseng dan sekalian menghindari terik matahari di yogyakarta membawa saya ke cafe ini bersama dengan keluarga saya dengan harapan yang tinggi karena tempat yang bagus serta berada di posisi yang strategis kami ke cafe ini pertama untuk tempat memiliki suasana santai dan nyaman tempat ini memiliki ruangan indoor dan outdoor cafe ini pun menyediakan musholla yang cukup luas serta toilet yang cukup bersih akan tetapi agak sulit untuk menemukan tempat parkir jika anda membawa kendaraan untuk pelayanan sangat disayangkan sangat kurang berdalih dengan alasan penggantian shift menjadikan pelayanan sangat turun kebanyakan makanan minuman habis padahal kami datang di siang hari jika menu habis pun sebaiknya diberitahukan dulu sedangkan pada cafe ini membuat kami menunggu baru menginformasi bahwa pesanan kami tidak tersedia overall sebenarnya memiliki potensi untuk bersantai ataupun bekerja dengan nyaman di tempat ini hanya saja perlu beberapa perbaikan seperti di atas keep up the work');
