INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJGaumkBpLei4ROxSwfo03bd0', 'Dian Erika', '5', 'best experience ever suka sekali dengan ambiencenya mas ponco dan mbak addel juga baik banget mantab betul servicenya tempatnya cocok banget buat ngopi orang introvert seperti saya ðŸ¤­ kopinya enaaaak cheese cake buatan mbak addel juga enak monangis harganya jauh lebih bersahabat daripada kopi kekinian really worth it kalau ke jogja lagi wajib balik ke sini sih oh ya klo beli beans di sini bisa request digrind sekalian tipe grindnya juga bisa request kemarin beli minta tolong digrind sekalian buat tubruk');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJGaumkBpLei4ROxSwfo03bd0', 'Yunita Gouwtama', '5', 'tempat ngopi yang dilayani dengan ownernya langsung jam buka hanya di hari dan jam tertentu diwajibkan melihat postingan instagram terupdate cheese cake terbaik dan terenak yang pernah saya coba tidak menyediakan kopi fancy dan gula paduan coffee latte dan cheese cake merupakan pasangan terbaik untuk menemani harimu');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJGaumkBpLei4ROxSwfo03bd0', 'Sahid Dipa', '5', 'kopi yang mengajarkan keindahan dalam kesederhanaan yang tercerminkan juga dari mas baristanya pitutur selalu menjadi tempat â€œmeditasiâ€ bagi saya melalui secangkir kopi yang diproses dengan sepenuh hati dan keramahan dari mas ponco es kopi susunya yang juga menurut saya es kopi yang â€œjujur dan halusâ€ jika ke jogja saya mewajibkan untuk mampir sebentar kesini');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJGaumkBpLei4ROxSwfo03bd0', 'chaya wirayatno', '5', 'tempatnya walaupun kecil tapi sangat nyaman berbeda dengan coffee shop kekinian lainnya pitutur kopi melayani customer one by one dalam ruangan jadi agak ngantri sedikit hehe tp benarÂ² worthed kopinya enak dengan pilihan beans yg fresh dan disajikan oleh masmbak barista yg ramah benarÂ² menjadikan salah satu pengalaman ngopi yg menyenangkan bagi saya will be back again definitely');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJGaumkBpLei4ROxSwfo03bd0', 'Anastasia Aurora', '5', 'enak bgt aku suka rasa experience mantap harga jg affordableâœ¨ cheesecake nya enak juga ðŸ¤¤ jam buka nya kalau kalian cek di instagram ada di setiap postingan terakhir ya gais mereka update bgt kok ig nya');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJGaumkBpLei4ROxSwfo03bd0', 'Wildan Z', '5', 'ngopi disini asik banget mas mbaknya asik di ajak ngobrol berasa punya kakak yg nyambut adiknya terharu banget balik sini karna kopinya seduhannya mau manual brew atau cappuccino nya tiada dua di tambah cheese cakenya aduh kombinasi yang pas untuk oleholeh bisa beli beansnya â€¦');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJGaumkBpLei4ROxSwfo03bd0', 'Yunisa Ayu Mentari', '5', 'id say this is one of the best experience of drinking coffee bukan cuma sekedar duduk nongkrong apalagi kerja gausha ngarep tempat ini emang paling pas buat sharing dan nikmatin kopi personal dan intimate experience nya worth to wait cheese cakenya juga dipesen ya enak');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJGaumkBpLei4ROxSwfo03bd0', 'Slim Clepto', '5', 'rasa yang mantab ada kopi filter dan cappucino cappucinonya rekomended untuk makanannya setau saya cuman ada cheese cake dan panakota ini juga rekomended banget alternatif lain untuk wisata kopi selain klinik kopi dan tdsh sayang untuk kamar mandi tidak ada klosetnya jadi yang cewe kadang ragu untuk menggunakan toiletnya jumat biasanya libur jadwal jam buka cek di instagramnya');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJGaumkBpLei4ROxSwfo03bd0', 'temanjalanmamang', '5', 'setiap lewat bausasran masih penuh harap kalau dia akan buka kembali toh furniturenya masih ada di sana semua ternyata pindah rumah sedang furniturenya sudah dijual tapi belum diangkut yang beli beberapa hari ke belakang sehabis hujan mampir ke rumah barunya suasananya kerasa lebih hangat sambutan mbak adel juga sama hangatnya ternyata konsepnya berganti jadi slow bar tapi tetep mas ponco yang seduhin kok lebih suka yang sekarang sih bisa saling ngobrol curhat atau apa kek bebas sembari diseduhin tapi plis kalau antrian di belakang udah banyak banget yaa sadarlah wahai manusia jangan terlalu nyaman nanti sayang diseduhin pangauban si favorit enak banget wanginya juga aduuh mau ke sana lagi sih sekalian cobain cakenya');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJGaumkBpLei4ROxSwfo03bd0', 'tika tika', '5', 'slow bar serasa main kerumah tetangga adem asri ramaaah banget jadi stiap kesana kita harus antri dlu private dn seru sih jd bnyaj ngbrol dan tentunya kopi nya enak');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJGaumkBpLei4ROxSwfo03bd0', 'citra riaswati', '5', 'surprised banget pertama kali nyobain ice caffe lattenya benerbener enaaak banget espressonya ngeblend sama susunya saya nobatkan menurut saya sebagai coffee shop dengan ice latte terenak anti gagal yang pernah saya coba di jogja suasana coffee shop yang teduh tenang dan benerbener bikin nikmatin banget secangkir kopi pelayanannya pun juga sangat ramah melayani pengunjung oya tak lupa dengan cake nya yang juga cocoook dan enak banget buat teman kopi salah coffee shop yang wajib dikunjungi bagi pecinta kopi kalau ke jogja');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJGaumkBpLei4ROxSwfo03bd0', 'Dimas Adianto', '5', 'slowbar coffeeshop terbaik yg ada di jogja untuk waktu buka nya hanya bisa diliat melalui instagram mereka');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJGaumkBpLei4ROxSwfo03bd0', 'Martina Millenidya Nishita', '4', 'salah satu slow bar yang oke dari tempat dan produk sebenarnya tapi kalau boleh saran mungkin kasih sedikit bumbu storytelling di awal untuk all customer bisa tentang pitutur itu sendiri biji kopi yang sedang dipakai bertanya ke customer tentang kopi yang paling disukai dan masih banyak lagi yang bisa dibahas waktu visit memang tempat dan suasananya enak banget untuk bersantai atau ngobrol dengan teman dekat tapi waktu di dalam order menu dan disiapkan langsung suasananya agak hening sayang aja gitu hehe tapi coffee lattenya enak tadi mau minta symple syrup atau sugar agak sungkan karena hening banget heheâœŒ note untuk parkiran mobil ada di depan pitutur');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJGaumkBpLei4ROxSwfo03bd0', 'Tozkoparan Craft Channel', '5', 'tempatnya cozy nyaman cocok buat penikmat kopi yang suka ketenangan suka baca buku merenung mencari inspirasi pokoknya yang ga suka berisik cocok ke sini selain itu baristanya jago menyeduh kopi plus kopi hasil roastingan di pitutur juga spesial bukan kaleng enaaak kamu juga bisa beli beans di sini untuk kamu yang suka teh di sini juga ada aneka teh yang enak untuk maianan ringan ada cheese cake yang legit abis top dah');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJGaumkBpLei4ROxSwfo03bd0', 'Chintia Angela', '4', 'tempatnya nyaman banget gaberisik kayak kafe kafe lain gituu yg unik tapi agak ribet adalah mau masuk harus lepas alas kaki tapi jadi berasa di rumah ada chesee cake btw banyak buku buku yg bisa dibacaa jual robusta yg enak enak juga disinii');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJGaumkBpLei4ROxSwfo03bd0', 'Muhammad Fachri Darmawan', '5', 'sebagai orang yang kalo minum kopi yang racikannya enak bisa langsung ngantuk saya pribadi kaget pas kena cappuccino sama americanonya auto watt mata saya kedai kopi paling terasa rasa rumahnya dan krunya sukses banget bikin saya nyesal pulang ke tempat asal meninggalkan yogya semoga bisa secepatnya mampir kembali');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJGaumkBpLei4ROxSwfo03bd0', 'fajri amanda', '5', 'komunikasi yang baik akan menghasilkan hubungan yang baik pituturcoffeeroasters');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJGaumkBpLei4ROxSwfo03bd0', 'andhy kurniawan', '4', 'maret tempat ngopi dg nuansa homie banyak bacaan buku buat tementemen yg suka baca tempatnya nyaman ada pilihan di luar atau di dalam ac jangan lupa untuk lepas alas kaki untuk masuk ke dalam masnya ramah banget buku menunya unik juga nih cocok buat ngobrol santai atau ramerame');
