INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJM1Kwqctfei4RwcydCM40Hbw', 'Laetitia Karenina', '3', 'awal masuk rasanya nyaman banget nih cafe terus tanya ke bar karena tau ada aplikasi khusus dipandu buat top up dan juga redeem voucher free signature coffeenya pelayanannya cepet mungkin karena aku datengnya nggak di pas jam rame aku duduk di lantai dimana ada space outdoor dan indoornya bagusnya lagi banyak ada stop kontak disana rasa kopinya juga lumayan enak kenapa bintang ya karena baru kali ini ke cafe tapi merasa terintimidasi dengan tatapan orang lain semoga pelayanannya lebih baik dan lebih bisa menempatkan situasi dan posisi customer');
