INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJR9ZkhZRZei4RNdf8Ba8rNYk', 'Ega Kayadoe', '5', 'sering banget lewat jalanan ini lewatin coffeeshop ini tp baru kali ini nyempetin mampir sambil ada yg harus dikerjain okee first of all baristanya ramah menyambut dengan senyum dan greetings yg hangat ngga pelit utk kasih info waktu saya tanya tanya menu dan detil racikan kopinya yg mana selalu iseng saya lakukan setiap ke coffeeshop yg baru saya kunjungi minuman sangat beragam ada coffee based tea based milk based mocktails meski ada yg belom ready light bitesnya ada cinnamon rolls dan donat mirip donat kalis tadinya saya mau order cold brew sparkling tp belom ready jadinya si barista menyarankan menu lain which is good americano plus orange dan seperti ada sedikit soda yg memang menu seperti ini mulai sering ditemui di coffeeshop lain tp ini enak semua rasanya imbang dan menyatu kemudian saya order jg almond donut enak banget empuk dan tidak terlalu manis saya duduk di bar supaya bisa ngobrol sama baristanya yg lucu ternyata kita sama sama dr bandung jadinya kocak aja ngopi di jogja tetep ketemu orang bandung juga dan ngobrol pake bahasa sunda meski tempatnya terbilang kecil tapi pw banget ngopi sambil laptopan di sini pilihan musiknya jg bagus fyi waktu saya ngopi di sini mereka pasang lagulagunya the smith pas banget next time pasti ke sini lagi mau coba lantai nya sepertinya bakal menarik jg see you soon and thank you for the great service and coffee');
