INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJAc6cnmtZei4RWw5l_UGCy5E', 'Nur Vita Yulianti', '5', 'salah satu soto lenthok yang enak di jogja sotonya hanya ada ayam tidak ada daging pendamping lauknya ada banyak dari satesatean tempe bacem tahu bacem mendoan krupuk dan lenthok ada life music nya juga disini pengunjung bisa request lagu harganya masih terjangkau dan bisa jadi destinasi kuliner kalau lagi di sekitar malioboro stasiun tugu rasa harga jl mangkubumi jogja depan bank bca');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJAc6cnmtZei4RWw5l_UGCy5E', 'Anissa Rizkianti', '5', 'salah satu menu sarapan pagi yang tidak boleh dilewatkan jika sedang berada di dekat kawasan stasiun tugu yogyakarta soto ayamnya unik karena menggunakan lenthok atau perkedel singkong harganya juga murah sotonya enak karena kuahnya gurih dan isian ayamnya lumayan banyak disajikan dengan sate atiampela tempe dan tahu bacem kalau makan di tempat kita akan ditemani dengan alunan musik dari pemusik jalanan');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJAc6cnmtZei4RWw5l_UGCy5E', 'Sukma Pragma', '5', 'soto ayam di sekitar stasiun tugu biasanya ada live music side dish nya ada sundukan ati ampela tahu bacem tempe goreng dan lenthok harga soto skitar rb');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJAc6cnmtZei4RWw5l_UGCy5E', 'Linggo Ajip', '4', 'soto langganan sejak kuah soto benar panas jadi makannya berasa segar lenthok singkong krispi di luar dan cukup lembut di bagian dalam selalu nambah lenthok tiap kali makan pilihan sate dan topping tambahan lainnya siap menemani soto panas yang dihidangkan porsi wajar mengenyangkan bila pesan nasi pisah seperti akan lebih mengenyangkan');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJAc6cnmtZei4RWw5l_UGCy5E', 'po ya', '3', 'soto yang terletak di jalan mangkubumi depan bca tipe soto ayam kampung yang oily kl menurut ku sih rasanya kurang yaa karna aku kurang suka yg oily gitu dan menurut saya sih biasa aja makan soto di sini ditemani pemusik dg suara yg lumayan bagus hihi');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJAc6cnmtZei4RWw5l_UGCy5E', 'Desiandi Sayful', '5', 'soto lenthok kuah gurih khas jogja pada saat review ini saya sedang mengurangi nasi jadi saya pesan soto tanpa nasi selalu pengin kembali ke jogja jika keinget kuah gurihnya');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJAc6cnmtZei4RWw5l_UGCy5E', 'Aliv Viola', '5', 'warung tenda yang menjual porsian soto ayam beserta aneka lauk pauk khas jogja yang bikin candu adalah ada pekerja seni yang mengiringi laguÂ² nostalgia dan menemani kami utk menikmati santapan pagi manthuuuuuul');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJAc6cnmtZei4RWw5l_UGCy5E', 'Rifqi Adam', '4', 'soto enak dengan harga standar yang dekat dengan stasiun yk kuah dan bumbunya enak toppingnya banyak dengan harga yang terjangkau kalau hari minggu pagi terkadang ada live music');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJAc6cnmtZei4RWw5l_UGCy5E', 'Nurgi Yanto', '5', 'soto isi gorengan ketela rasanya lumayan enak campur tahu bacem lebih jos');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJAc6cnmtZei4RWw5l_UGCy5E', 'Taufan Yusuf Nugroho', '5', 'soto ayam lenthok pak gareng ini menjadi salah satu kuliner favorit di jam sarapan di kota jogja soto ayam ini sudah menjadi yang legendaris di kota jogja letaknya juga strategis di dekat stasiun tugu yogyakarta persisnya di dekat perlintasan kereta api jl malioboro citarasa sotonya sedap banget kemudian banyak topping yang menjadi pelengkapnya harganya juga masih terjangkau dengan porsi besar soto ayam campur nasi hanya seharga rp daripada penasaran langsung jajal aja');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJAc6cnmtZei4RWw5l_UGCy5E', 'yusuf syaifudin', '5', 'soto terenak yang pernah saya makan di jogja harga soto sama nasi bisa dipisah atau campur udah termasuk lenthuk semacam perkedel singkong di sotonya selain itu disediakan makanan pendamping seperti tahu bacem tempe mendoan kerupuk lenthuk sate dan lainlain kalau kurang puas cuma makan nasisoto tentu saja yang paling enak adalah kuahnya dan lenthuknya yang bikin unik lokasinya dekat malioborostasiun tugu buka dari pagi sampai siang sekitar jam an');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJAc6cnmtZei4RWw5l_UGCy5E', 'Icha Saleh', '4', 'salah satu tempat makan soto favorit walaupun agak jauh dari rumah harga perporsi enak dan kenyang murah pula kalo ke jogja wajib coba lokasinya deket sama stasiun tugu jadi kalo uda makan bisa sekalian foto di stasiun ato langsung ke malioboro kadang ada live music nya bayar seikhlasnya');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJAc6cnmtZei4RWw5l_UGCy5E', 'Mas Pandu', '5', 'kalau mau cari sarapan dekat stasiun tugu ini recommended harganya murah rasanya enak semua karyawan sampe tukang parkirnya juga ramah kalau beruntung ada pengamen yang bisa dibilang niat banget berasa live music');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJAc6cnmtZei4RWw5l_UGCy5E', 'Julita Medianti', '5', 'soto ayam yang khas ada lenthoknya yaitu perkedel ketelarasanya asin gurih plus suiran ayam pelengkap lainnya ada tempe mendoan tempe keripik tahu bacem sate ayam sate telur puyuh sate ati ampela dan perkedel lenthok pengamen dsini juga bagus bangett');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJAc6cnmtZei4RWw5l_UGCy5E', 'Alfirliasa', '5', 'ini lumayan enak side menu nya juga lengkap ada aneka gorengan sate jeroan sate telur aneka bacem dll sayang enggak foto banyak disini waktu itu pas jam sarapan jadi ramai yg makan di tempat ada live music dari pemusik lokal seru');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJAc6cnmtZei4RWw5l_UGCy5E', 'a lisnanto gathi', '3', 'soto ayam disini menggunakan lenthuk yakni seperti perkedel tapi terbuat dari ketela rasanya gurih asin salah satu tempat favorit untuk sarapan jangan lupa utk mencicioi sate usus dan sate ati sebagi kauk pendamping warung soto ini letaknya di jalan mangkubumi dekat denga stasiun tugu dan malioboro buka dari pagi hingga siang');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJAc6cnmtZei4RWw5l_UGCy5E', 'Sri Rahayu Ningsih', '5', 'soto kaki rasa bintang sotonya mantabkuahnya berasa kaldunyatempatnya sederhana tapi lumayan bersihsoto ayam kampung dan ada lauknya sate jeroan tahu tempe dan tak lupa lenthoknyaini yg membuat sotonya lain dari pada yg lain ada juga group musik jalanan yg menetap mengiringi sarapan pagi kitalumayan bagus musik penyanyinya');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJAc6cnmtZei4RWw5l_UGCy5E', 'Latifah Maulida Rahma', '5', 'harganya terjangkau yang saya foto ini nasi soto campur harga perporsi rb pelayanannya sangat ramah dan banyak disediakan lauk juga seperti sate ati tahu tempe patut untuk dicoba');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJAc6cnmtZei4RWw5l_UGCy5E', 'Propagardha', '5', 'kata pertama untuk tempat makan disini enak soto lenthok yang sesuai dengan soto lenthok ada berkedel dan ada pilihan perkedel dalam toples nya yg dijual terpisah jika didalam satu porsinya dirasa kurang');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJAc6cnmtZei4RWw5l_UGCy5E', 'Lutfi Retno Wahyudyanti', '4', 'rasanya lumayan harganya terjangkau cocok untuk sarapan kalau sedang olahraga atau liburan dekat tugu selain soto bisa juga menambah lauk seperti sate telur sate usus jerohan dan tempe');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJAc6cnmtZei4RWw5l_UGCy5E', 'Elin Widia', '4', 'terletak di utara stasiun tugu buka dari jam pagi kalau liburan atau wekeend isinya tamu dari luar kota yang mengunjungi jogja harga soto rb porsi isiannya macem tergantung selera selain disini ada juga soto gareng di parkiran pasar lempuyangan');
