INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ9WRgXEnlei4RPwu6gLY7CU8', 'Efi Kurniyawati', '5', 'lokasi berada di seberang halte bus kusumanegara interiornya warung makan biasa ruangan semi outdoor suasana ramai saat jam makan pagisiang pegawai fasilitas untuk area parkirnya cukup bisa menampung motor dan mobil table yang cukup pelayanan ramah dan cepat harga standar kantong mahasiswapelajar menu menyediakan berbagai variant menu soto rawon kupat tahu rasa worth it dan must try bagi yang belum pernah ke sini sangat direkomendasikan untuk mencoba tempat ini');
