INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ9WRgXEnlei4RPwu6gLY7CU8', 'Mariani Sutanto', '4', 'satu lagi warung jawa timuran yang menggugah seleraku walau ada sedikiiiit rasa manis tercecap oleh lidahku walau papan namanya soto lamongan tetapi tersedia pula menu nasi rawon rawon selalu menjadi favoritku di mana pun sotonya enak ada taburan bubuk koya di atasnya seperti yang lazim di surabaya rawonnya juga enak rasanya walau ada sedikit rasa manis di antara gurihnya kuah rawon harganya sangat terjangkau rp untuk soto dan rawon campurnya cuss ke sini lagi kalau lagi rindu masakan jawa timuran');
