INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ9WRgXEnlei4RPwu6gLY7CU8', 'Leni ananda', '4', 'rasa standard harga murah pas buat sarapan pilihan menu banyak ada soto rawon tahu campur besok tambahin gorengan ato satean biar agak rame bos');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ9WRgXEnlei4RPwu6gLY7CU8', 'Dinar Surya oktarini', '5', 'soto surabaya banget yang kangen soto jawa timur wajib kesini disini sotonya enak banget plus koya yang bikin enak tempatnya nyaman dan bisa bareng bareng kesini pesen soto atau tahu campur gak susah ditemukan karena di pinggir jalan arah balai kota yogya servinya cepat dan banyak pilihan sambal dan koya serta jeruk nipis yang melimpah');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ9WRgXEnlei4RPwu6gLY7CU8', 'Ika Rakhmawati Hilal', '4', 'langganan di sini sejak warungnya masih warung tenda di seberang jalan salah satu warung khas lamongan yang eksis di kota yogyakarta sotonya enak tahu campurnya juara rawonnya joss gandos usul ya cak mangku gimana kalau garam dan vetsinnya dipisah enggak dicampur di kuahnya langsung kuahnya lebih segar deh dan para penderita hipertensi yang diet rendah garam bisa makan dengan save');
