INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJS9YGVstZei4RoLUnDQ5UTCc', 'Tyas D Arini', '5', 'salah satu coffee shop favoritku di jogja tempatnya agak tersembunyi walau di tengah kota cafenya ada di belakang lotek gadogado sagan hampir sebelahan dgn ikan bakar bu bambang tempatnya ada bagian di luar atau outdoor dengan ambience alaÂ² bali vibes haha di dalam dan di lantai atas dengan kursi dan meja yg ditata minimalis cafenya sangat nyaman untuk mengerjain tugas sekedar hang out dengan teman atau bahkan untuk meeting dilengkapi dengan colokan di beberapa tempat dan wifi suasananya juga enak tenang dan baristanya ramahÂ² waktu favoriteku disini adalah pagi kalau tidak salah jam cafe ini sudah buka sangat enak buat fokus ngerjain tugas atau kerjaan karena masih sepi dan nyaman udah gitu playlistnya oasis gimana aku ga suka haha coffeenya juga enak waktu itu sempat coba kopi susu sagan kopinya cukup kuat dan manis susunya cukup terasa kalau pagi kadangÂ² ada donut gula yg enak cocok buat temen minum kopi selain kopi juga ada varian non coffee seperti green tea latte dan varian teh coffee shopnya sangat oke banyak spot instagramable utk ciwiÂ² yg pengen foto haha sukses terus tekoff');
