INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJc2Jhi9hNei4Rq5WuZ7BpZ8M', 'irkhamudin Pandhawa', '4', 'menyempatkan diri mampir untuk review salah satu resto terkenal di jogja legend dari kunjungan kami kami memberikan bintang dengan pertimbangan area parkir mobil di bahu jalan parkir motor muat banyak kelengkapan cuci tangan sabun dan pengecek suhu ada suasana model rumah lawasan kombinasi dengan meja makan outdoor khas anak muda menu cukup bervariatif range harga masih bisa dijangkau anak kuliahan kami memesan menu standar yang paling sering dipesan pada umumnya nasi goreng ayam spaghetti carbonara steak ayam blackpapper dari segi rasa chicken steak paling berterima di lidah untuk nasi goreng agak sedikit asin sedangkan spaghetti belum berterima di lidah untuk suasana makan cukup mendukung bagi semua kalangan usia baik anak muda maupun orang tua sehingga kami simpulkan bahwa resto ini cukup rekomended untuk menjadi tujuan makan sekaligus happy time bersama rekan');
