INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJHwz-Po5Xei4R-N7qyxtHbGE', 'Regina FY', '5', 'jogjakarta malam ini dingin sekali habis hujan hampir sepanjang sore jadi kepengen makan yg kuahkuah meluncur lah pergi ke arah alunalun lokasi sesuai googlemaps pasti sampai punya easy to find saat sampai di lokasi titiknya agak meleset dikit majuan dikit lagi kearah sudut dia agak ketutup pohon patokannya toko dagadu di sudut klo dah kelewatan si dagadu artinya dah kelewatan suasana resto nya agak balik lagi ke masa lalu traditional alias jadul sampai disini emang kebetulan perut dah keroncongan sangat burulah pesan tengkleng kuah tongseng nasi putih gak expect apaapa pas decide makan kesini ternyata turn out very very good eunakk banget ini skrg jadi masuk ke resto yg kudu wajib mampir lagi klo maen ke jogjakarta isi main dish menu disini semua daging kambing tengkleng kuah goreng tongseng sate ini kambing semua kalau gak suka kambing gak bs makan disini dong bisa mereka ada menu lain nasi goreng ayam dan paket ayam goreng tbh saya bukan penggemar daging kambing sama sekali tapi ini tengkleng dan tongseng nya enak sekali tidak bau sama sekali pengolahan yg amat sangat baik daging nya pun besar empuk dan banyak untuk ukuran di setiap porsi nya saat pertama kali nyobain pas nyendok kuah tongseng nya buat saya agak kurang kick pedas nya pengen nambah lagi cabe rawit di dalam tongseng nya but niat tersebut dibatalkan karena ngerasa seharian ini dah makan pedaspedas melulu dari makan pagi ke makan siang jadi gak perlu minta cabe rawit lagi deh makan sesuai racikan empunya aja but at the end nya jadi kepedesan juga wkwkkwk how come si tengkleng ini agak pedas lada kuah nya trus pas makan nasi putih itu gonta gantian menu nya nasitengklengtongsengrepeat sampai habis akhir nya pas nasi habis baru berasa pedas nya mpe ngomong gini gile pedes juga ya untung tadi gak minta cabe rawit bisa tambah pedes overall enak daging besar juga pertahankan ya next time saya a