INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ-1OO3xhZei4RpiUw_jIlPBQ', 'Ronald Riwut', '5', 'vibenya menyenangkan ini meetup dgn teman dia tau tempat ini dr google signage agak ketutup baru tau ada cafe dijalan ini parkiran kecil ya pas datang sih kosong tapi pas pulang harus nunggu panggil org yg parkir di belakang mobil saya mungkin ada parkir lain yg saya tidak tahu sayang pas datang kondisi hujan tempatnya ada indoor dan outdoor saya dari siang ke malam ditempat ini jadi merasakan vibenya dan yakin ini bakal menyenangkan setelah cerita dgn karyawan setempat ternyata ini bekas hotel jadi ada ruangan dgn dekor tradisional awalnya sempat mikir museum jg ternyata dekorasi memang seperti itu dari ownernya yg sepertinya berhubungan dgn batik ada galeri batik jg disini sempat masuk ke daerah privat owner krn ya memang tidak melihat signage apapun jg yg tidak memperbolehkan org makanan sih standar saya cuma minum kalo diliat dr pesanan teman saya sih makanan beratnya terlalu standar snack dan makanan ringan seperti tempat biasa minumannya enak coba diperbanyak lagi variannya ini tempat enak buat nongkrong lama dan bercengkrama utk tugas atau kerja jg enak tinggal cari spot duduk yg tidak ramai next time sih bakal coba lagi kondisi pas cuaca cerah');
