INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ-1OO3xhZei4RpiUw_jIlPBQ', 'Anton Pramono', '5', 'jogja salah satu rekomendasi kedai kopi buat kamu yang suka suasana rimbun oleh hijauan dedaunan udah kayak jugle in the city hehehe asri dan rindang alternatif healling dari riuhnya lalulintas di diy meskipun sedikit ada suara lalulintas kendaraan tapi ga agakan kekganggu deh oleh suara kenlpot mber mber an hehe kalo ngopi di sini serasa ngopi dengan vibes taman ala perkotan gais bakal betah dehh pasti oya jangan lupa cobain kopi susu signature dr tugulor yaah taste gula arennya legit dan nagih beneran ga boong okey lanjut untuk area tempat nongkrong cukup flexible ya gaiss mau indoor no smoking area bar semi indoor atas dan outdoor sesuaikan dengan kebutuhan dan kondisi cuaca pastinya tapi bakal asik banget sih kalo nongkrong ramean bareng circle kalian ngoborol di area outdoorr sembari menikmati hijauan pepohonan peh syahdu ga tuh');
INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJ-1OO3xhZei4RpiUw_jIlPBQ', 'dwi suci hartini', '4', 'kafe ini berada diantara hotel yaitu hotel tentrem dan mustokoweni tampak kecil dari luar tetapi ternyata tempatnya luas memanjang kedalam teduh dan adem karena ditanami banyak pepohonan untuk yang datang dengan mobil kemungkinan parkirnya agak kurang nyaman dan dipinggir jalan karena tempat parkirnya gak luas pilihan menu makanan dan minuman lumayan beraneka ragam terakhir berkunjung sy dan temanteman sy memesan olahan nasi secara pribadi sy kurang suka dengan nasinya karena masakannya model pero kaku keras');
