INSERT INTO Reviews (Place_ID, Name, Star, ReviewText) VALUES ('ChIJiScNOSxnei4R2sSfvWW23mI', 'Hubertus Gilang OJI', '5', 'saya bisa bilang salah satu tempat makan yang boleh dicoba bila main ke kawasan kaliurang kebetulan kesini karena ikut beberapa teman dimana suasananya tempatnya cukup unik sekali terlebih pada saat malam hari yang cukup dingin selepas hujan tempatnya bisa buat spot nongkrong juga saya rasa kebetulan saya mencicipi bakmi goreng telur sosis yang saya rasa cukup nikmat dan hangat saat disajikan tidak lupa jeruk hangat sampai total yang saya bayarkan kurang lebih rp');
